from typing import List


class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        def get_feature(s):
            c = [0] * 26
            for ch in s:
                c[ord(ch) - 97] += 1
            return c

        l_p, l_s = len(p), len(s)
        l, res = 0, []
        p_f = tuple(get_feature(p))
        temp = get_feature(s[l:l + l_p])

        while l+l_p<=l_s:
            if tuple(temp) == p_f:
                res.append(l)
            if l+l_p == l_s:
                break
            temp[ord(s[l]) - 97] -= 1
            temp[ord(s[l+l_p]) - 97] += 1
            l += 1
        return res

s = Solution()

